	TripsMET5I_2(List<Stops> stops, String[] times) {
		this("Rochdale, Rochdale Railway Station (Manchester Metrolink)",
				stops, times);
	}

	TripsMET5I_2(String head, List<Stops> stops, String[] times) {
		this.head = head;
		this.stops = stops;
		this.times = times;
	}

	public String getHeadline() {
		return head;
	}

	public List<Stops> getStops() {
		return stops;
	}

	public String[] getTimes() {
		return times;
	}

	public String getTime(NamedLocation spot) {
		for (int i = 0; i < stops.size(); i++) {
			if (stops.get(i).getName().equals(spot.getName())) {
				return times[i];
			}
		}
		return "";
	}

